import React, { Component } from "react";
import axios from "axios";

export default class DisplayOrders extends Component {
  constructor(props) {
    super(props);
    this.state = {
      listData1: [],
    };
  }
  componentDidMount() {
    console.log(this.props.location); // it is equal to yourData
    this.setState({ listData1: this.props.location.state });
  }

  render() {
    return (
      <div>
        <div style={{ textAlign: "center", fontWeight: "bold", fontSize: 18 }}>
          <label>Order Details</label>
        </div>
        <table style={{ width: "100%" }}>
          <tr>
            <th>Serial Number</th>
            <th>Parcel Id</th>
            <th>Arrival Date</th>
            <th>Sender</th>
            <th> Location Id</th>
            <th> Location Name</th>
            <th> User Name</th>
            <th> User PhoneNumber</th>
            <th> Delivery Status</th>
          </tr>
          {this.state.listData1 !== undefined ? (
            <tr>
              <td>1</td>
              <td>{this.state.listData1.parcel_id}</td>
              <td>
                {moment(this.state.listData1.last_updated).format("MM/DD/YYYY")}
              </td>
              <td>{this.state.listData1.sender}</td>
              <td>{this.state.listData1.location_id}</td>
              <td>{this.state.listData1.location_name}</td>
              <td>{this.state.listData1.user_name}</td>
              <td>{this.state.listData1.user_phone}</td>
              <td>{this.state.listData1.status}</td>
            </tr>
          ) : (
            []
          )}
        </table>
      </div>
    );
  }
}
